const Producto = () => {
    return ( 
        <h1>Propducto</h1>
     );
}

Producto.getInitialProps = ()=>{
    return fetch('https://api.github.com/repos/developit/preact')
    .then(res => res.json()).then(console.log)
};
 
export default Producto;
